    state={
        text: ''
    }
    render () {
        return (
            <div className="Task">
                <TextField value={this.props.text} placeholder="Nova tarefa"/>
                <IconButton type="submit" onClick={(e) => {
                            console.log('e', e);

                    alert(e)
                }}>
                    <SaveIcon />
                </IconButton>
            </div>
        );
    }
}

